import Navbar from './components/navbar';
import Home from './components/home';
import About from './components/about';
import './App.css';
import { Router } from 'react-router-dom';

function App() {
  return (
    <div>
      <Switch>
        <Router path="/" exact></Router>
      </Switch>
      <Navbar/>
      <Home/>
      <About/>
    </div>
  );
}

export default App;
